    "soar-ii",nt"isopen": true,nt"url": null,nt"notes": "SOAR II will
    support the ARP's AIP and PFC programs, collecting and processing data for approximately
    1,000 air carriers at over 2,300 U.S. airports annually. The system will support
    FAA's air carrier activity, grants administration, project planning, and compliance
    processes by providing an integrated system that serves both ARP internal users
    and external stakeholders. By replacing the current system entirely, ARP will be
    able to support constantly evolving needs in terms of program oversight, organizational
    transparency, data normalization and standardization of processes. Replacing the
    legacy system with modern technologies will help the ARP keep pace with the FAA's
    NextGen efforts and the Administrator's vision for the year 2025.",nt"license_title":
